INSERT INTO `mgms_bugnote_text_table` VALUES ('17', '• Fueron creadas las siguientes personas como destinatarios para todos los operadores:\r\no CLARA INES ANGARITA\r\no ADRIANA MILLAN\r\no MARIA CRISTINA HENAO\r\no ANDREA USECHE\r\no INGREED VELASQUEZ\r\no JOSE MAURICIO ROBAYO\r\no SHIRLEY COVALEDA\r\no CONSUELO MOSCOSO\r\no DIANA MELO\r\no JOHANNA BARON\r\no NANCY DIAZ\r\n\r\n• Se requiere la adición de área Sistemas de información en la casilla tema. \r\n• RTA / MGM: Existe un tema GESTIÓN TÉCNICA que maneja un subtema SISTEMA DE INFORMACIÓN , por favor indicar si es suficiente con este tema o se debe crear como tema SISTEMA DE INFORMACIÓN y confirmar el subtema, a continuación el despliegue de los que exite:\r\n \r\n\r\n• Adjuntamos MANUAL DE USUARIO para el uso del Módulo documental de la aplicación, adicionalmente si lo consideran necesario podemos dar una capacitación orientada por un analista de datos que documenta Gestores documentales, esta capacitación la podemos ofrecer aquí en el Edificio GER de acuerdo a su disponibilidad, o si lo prefieren por Skype Mañana de 11 am a 12pm.\r\n\r\nQuedamos atentos a su confirmación para programar capacitación y cerrar el ticket. \r\n\r\n');
