INSERT INTO `mgms_bugnote_text_table` VALUES ('26', 'Buenas tardes Deisy,\r\n\r\nEn atención al ticket 1090 te comento:\r\nLa información mencionada fue actualizada por el Ing Jose Luis.\r\nEl ajuste solicitado fue realizado.\r\nPor favor validar el ajuste en ambiente producción.\r\n\r\nQuedamos atentos a tus comentarios.\r\n\r\nCordialmente,\r\nJeimi Patricia Saez Montaña\r\nAnalista de sistemas de información y BD.\r\nMGM S.A.S.\r\nCalle 28 No. 20-50\r\nTel: (571) 3904699 ext: 113\r\nE-mail: yeimi.saez@mgms.com.co\r\nBogotá D.C., Colombia.');
