INSERT INTO `mgms_bugnote_text_table` VALUES ('28', 'Buenos días,\r\n\r\nEn atención al ticket 1091 me permito informar la creación de los usuarios solicitados, a continuación las credenciales a utilizar:\r\n\r\nwilmer ramirez delgado\r\nwramirez.delgado\r\nW123456*\r\n\r\nRaul Alejandro Contreras\r\nraul.contreras\r\nR123456*\r\n\r\nMaría Milena Beltrán\r\nmaria.beltran\r\nM123456*\r\n\r\nJairo Fernando Duarte R\r\njairo.duarte\r\nJ123456*\r\n\r\nJuan Pablo Castiblanco\r\njuan.castiblanco\r\nJ123456*\r\n\r\nAndrés Felipe Olaya\r\nandres.olaya\r\nA123456*\r\n\r\nRespecto al usuario José Arturo Pacheco, se informa que ya cuenta con un usuario creado en el sistema con una cuenta de correo diferente a la solicitada, por favor confirmar si se debe crear un usuario nuevo o se utilizará el actual, el usuario creado es:\r\n\r\nJose Arturo Pacheco\r\njose.pacheco\r\njose.pacheco@redcom.com.co\r\n\r\n\r\nQuedamos atentos a sus comentarios.\r\n\r\nCordialmente, \r\n\r\n\r\n \r\nJeimi Patricia Saez Montaña\r\n	Analista de sistemas de información y BD.\r\n	MGM S.A.S.\r\n	Calle 28 No. 20-50\r\n	Tel:  (571) 3904699 ext: 113\r\n	E-mail: yeimi.saez@mgms.com.co\r\n\r\n	Bogotá D.C., Colombia.');
