INSERT INTO `mgms_bugnote_text_table` VALUES ('43', 'Buen día:\r\n\r\nDe acuerdo a las validaciones realizadas se encontró que los documentos se encuentran en las carpetas: \r\nSKYNET_1036_2012\r\nSKYNET_683_2015\r\n\r\nPero el sistema realiza la consulta a las carpetas: \r\nSKY_1036_2012\r\nSKY_683_2015\r\n\r\nDe acuerdo a lo anterior se realizo la solicitud del RFC 131 a ITS donde se solicito el backup de la aplicación y de la base de datos con el fin de realizar las respectivas pruebas.\r\n\r\n\r\nCordial saludo,');
INSERT INTO `mgms_bugnote_text_table` VALUES ('44', 'Buenas tardes.\r\n\r\nEn respuesta a su solicitud del ticket 1102 se realizaron las respectivas correcciones en el sistema a la hora de descargar el excel en el modulo de compromisos.\r\nPor favor verificar en el sistema, quedaremos atentos a su respuesta.\r\n\r\n \r\nCordialmente.\r\n\r\n \r\n 1464023736522_PastedImage\r\nMICHAEL ESTEBAN MARENTES\r\nSoporte MGM\r\nMGM S.A.S.\r\nCalle 28 No. 20-50\r\nTel:  (571) 3904699 ext: 113\r\nE-mail: soporte@mgms.com.co\r\nBogotá D.C., Colombia.\r\n');
INSERT INTO `mgms_bugnote_text_table` VALUES ('45', 'Se queda pendiente a la respuesta del cliente.');
INSERT INTO `mgms_bugnote_text_table` VALUES ('46', 'Buenos días Germán: \r\n\r\nEn atención al ticket # 1098 y de acuerdo a las pruebas internas realizadas con el Backup solicitado la semana pasada; informamos que para dar solución al ticket es necesario realizar una ventana de tiempo para ejecutar el cambio en producción.\r\n\r\nTeniendo en cuenta lo anterior, solicito su confirmación acerca de la hora en la cual se realizara dicha ventana; proponemos realizarla hoy 23 de Enero de 2017 desde las 12:00 hasta las 13:00. Por favor tener en cuenta una vez definida la hora que los usuarios deben ser informados por parte de KVD para que no utilicen la aplicación durante este tiempo.\r\n\r\nQuedamos atentos. \r\n\r\n\r\nCordial saludo,\r\n\r\nWILMER ALEXANDER VARGAS DIAZ\r\n	Analista de sistemas de informaciòn y BD\r\n	MGM S.A.S.\r\n	Calle 28 #20 - 50 Piso 7\r\n	Tel: (571) 7434440 ext: 1216\r\n	E-mail: wilmer.vargas@mgms.com.co\r\n	Bogotá D.C., Colombia.');
INSERT INTO `mgms_bugnote_text_table` VALUES ('47', 'Se modifica la regla de negocio existente con el fin de permitir crear visitas de llamada telefónica cuando para el mismo sitio existe una visita en estado fallida. \r\n\r\nSe realizan pruebas en ambiente de producción antes de informar al usuario la modificación de la regla de negocio.');
INSERT INTO `mgms_bugnote_text_table` VALUES ('48', 'La solicitud fue resuelta por la ingeneniera Deisy Bibiana Pinzon.');
INSERT INTO `mgms_bugnote_text_table` VALUES ('49', 'Se cerro el ticket, a partir de ahora el campo entidad territorial para la creación de visitas con componente IETDH sera obligatorio.');
INSERT INTO `mgms_bugnote_text_table` VALUES ('50', 'El error se presento porque se crearon registros incompletos, se resolvió modificando desde BD los regsitros existentes, con el fin de adicionar el dato en la columna entidad territorial.\r\n\r\n\r\nPara futuros registros, este campo se configurará de tipo obligatorio garantizando asi, que no se vuelvan a crear registros con campos sin diligenciar.');
INSERT INTO `mgms_bugnote_text_table` VALUES ('51', 'Buenos días: \r\n\r\nDe acuerdo a la confirmación recibida por el usuario \"RFC-133(conf).pdf\", se ejecuto el RFC 133 para dar solución a la solicitud. \r\n\r\nAdjunto archivo \"RFC-133.pdf\" donde se realizo el envío, ejecución y confirmación del resultado exitoso del RFC.\r\n\r\nAdicionalmente, adjunto archivo \"0001098_ (resultado_OK).pdf\" donde se recibió la confirmación del usuario.\r\n\r\nTeniendo en cuenta lo indicado; se da por cerrada la solicitud.\r\n\r\n\r\nCordial saludo,\r\n\r\nWILMER ALEXANDER VARGAS DIAZ\r\n	Analista de sistemas de información y BD\r\n	MGM S.A.S.\r\n	Calle 28 #20 - 50 Piso 7\r\n	Tel: (571) 7434440 ext: 1216\r\n	E-mail: wilmer.vargas@mgms.com.co\r\n	Bogotá D.C., Colombia.');
