INSERT INTO `mgms_bug_text_table` VALUES ('11', 'Eliminar visitas - crear un segundo mensaje de alerta al eliminar la visita, si encuentra la Lista de Verificación diligenciada debe advertir que ya cuenta con la lista, al igual si tiene documentos o anexos, mostrar en el reporte \"Permitir el cierre despues de una segunda advertencia\", solo para perfil coordinador y Administrador.\r\nEs necesario tener el control de las eliminaciones por esta razón se utilizaran las siguientes tablas:\r\n\r\n• En la tabla Log_accion, se realizará un insert para crear un id_accion 3 “Eliminar registros”\r\n• En la tabla Log_sesion, se agregará un nuevo campo “REGISTRO” el cual contendrá:\r\no El nombre de la tabla donde eliminó el registro, id de cada registro\r\no Id de la visita\r\no Nombre del Componente\r\no Nombre de la institución\r\no Municipio \r\n\r\n• En la tabla Log_sesion, se agregará un nuevo campo “OBSERVACIÓN” el cual contendrá la observación que el usuario diligenciará después del mensaje de advertencia.', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('12', 'Debido a que se programaron visitas de Calidad 8 ahora para este mes de Diciembre de 2016, por favor incluir la pestaña de Calidad 8 en el SI para poder ingresarlas.', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('13', 'Se presentó un error en la creación de un reporte, la consulta si funciona en MYSQL pero no es posible crear el reporte. Se adjunta al correo la instrucción utilizada.', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('14', 'Solicito su colaboración en la revisión del sistema de información MANAGER P:\r\n• Se requiere la adición en la casilla destinatario (persona), las siguientes personas se vean reflejadas para todos los conceptos:\r\n\r\n CLARA INES ANGARITA\r\n ADRIANA MILLAN\r\n MARIA CRISTINA HENAO\r\n ANDREA USECHE\r\n INGREED VELASQUEZ\r\n JOSE MAURICIO ROBAYO\r\n SHIRLEY COVALEDA\r\n CONSUELO MOSCOSO\r\n DIANA MELO\r\n JOHANNA BARON\r\n NANCY DIAZ\r\n\r\n\r\n• Se requiere la adición de área Sistemas de información en la casilla tema.\r\n\r\n• Favor enviar un instructivo del manejo del sistema de información, donde especifiqué como realizar el cierre a los comunicados que necesitan respuesta.', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('15', 'Se solicita la revisión  de la modificación de las listas de verificación de las llamadas, cuando se quiere editar, el sistema no muestra fecha de la llamada, hora de inicio y hora de fin.', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('16', 'Solicito de su colaboración ya que estoy tratando de subir al sistema de información un comunicado y no ha sido posible porque aparece que el nombre del archivo esta vació, a continuación adjunto el soporte.', '', '');
