INSERT INTO `mgms_bug_text_table` VALUES ('21', 'Buenos días,\r\n\r\nEl día de hoy durante el registro de las llamadas de IEDTH se presentó el siguiente inconveniente con el sistema de información:\r\n\r\n•         Luego de realizar la planeación de un registro de llamada y de ingresar la encuesta como tal, nosotros editamos el estado del registro a “Ejecutada (Cierre)” en ese momento el sistema está borrando el nombre de la institución dejando así los registros con este campo vacío.\r\n\r\nAgradezco la atención prestada y quedo atento a cualquier inquietud.\r\n\r\n\r\nDEISY BIBIANA PINZON FLOREZ\r\nIngeniera de Sistemas - MENA\r\nCarrera 6 # 34 -70 , Barrio La Merced\r\nTel:  (571) 7452825  ext: 105\r\nE-mail: deisy.pinzon@cissas.com.co \r\n', '', '');
