INSERT INTO `mgms_bug_text_table` VALUES ('23', 'Estimada Erika, buenas tardes.\r\n\r\nAtentamente solicito la inactivación en Talento de todas las personas que hacían parte del Proyecto Ecopetrol Yacimientos (ya finalizado), a excepción de:\r\n\r\n•	Alexandra Carbonell\r\n•	Alejandra Delgado\r\n•	Claudia Sarmiento\r\n•	Jonny Morales\r\n\r\nMuchas gracias por tu ayuda.\r\n\r\nCordialmente,\r\n\r\n \r\nM.C. DEL PILAR GARAVITO G.\r\n	Coordinadora de Talento Humano\r\n	Avenida 28 # 20 – 50, Barrio Armenia\r\n	Tel:  (571) 3904699\r\n	E-mail: pilar.garavito@redcom.com.co\r\n\r\n	www.redcom.com.co\r\n\r\n	Bogotá D.C., Colombia.', '', '');
