INSERT INTO `mgms_bug_text_table` VALUES ('26', 'El ticket #1090 se generó por un error al momento de modificar las visitas para el componente IETDH, no mostraba los datos que habían sido registrados, para esto, se determinó que el error parte del hecho que no estaba siendo capturado la entidad territorial, el campo se incluyó y los registros existentes se modificaron desde la BD. \r\n\r\nEl presente ticket se crea con el fin de modificar el proceso, a partir de ahora el campo entidad territorial será obligatorio y sin diligenciarlo no será posible diligenciar el establecimiento educativo.', '', '');
