INSERT INTO `mgms_bug_text_table` VALUES ('74', 'Buena tarde Erika.\r\n \r\nEnviamos los resultado de las pruebas que realizamos:\r\n \r\n1.       Después de agregar la actividad y guardar los datos y seleccionar el registro a tratar para generar la tarea y cambie de color, se genera un error.\r\n\r\n \r\n2.       En el inventario de extintores no se puede editar se queda cargando y no da la opción para agregar nuevos extintores.\r\n\r\n \r\n3.       En el inventario de botiquines no se puede editar se queda cargando y no da la opción para agregar nuevos botiquines.\r\n\r\n \r\n \r\n4.       En la parte de tipo de botiquín al seleccionar un botiquín y editarlo los elementos del botiquín no se pueden modificar es decir no se puede editar y agregar nada.\r\n\r\n \r\n5.       Se pueden agregar otros tipos de botiquín, pero no se pueden agregar los elementos del botiquín.\r\n\r\n \r\n \r\nQuedo atenta a sus comentarios.', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('75', 'Buenos días, dando continuidad al proceso de diseño y creación del gestor documental del Consorcio Redes Postales, remito la siguiente información:\r\n \r\n1.       Actualización de la tabla de documentos y comunicados con sus respectivos temas y subtemas: Matriz en Excel donde se evidencia los temas y subtemas para Comunicados y Documentos\r\n2.       Confirmación del código de los comunicados: Para los comunicados enviados por CRP a MINTIC: SP-CRP-SVC-XXX-XX\r\n        Para los comunicados enviados por CRP Al Operador Postal Oficial 4-72: SP-CRP-OPO-XXX-XX\r\n3.       Definición de los equipos de trabajo: Se solicita dejar habilitado el listado de todos los usuarios para asignar a cada responsable según la naturaleza del comunicado y/o documento.\r\n \r\n \r\nQuedo atenta a cualquier inquietud.', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('76', 'Buenas tardes,\r\n \r\nAdjunto se encuentra el documento con las modificaciones sugeridas al sistema de información por parte de los interventores.\r\n \r\nDe ante mano gracias por su atención  y colaboración.', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('77', 'Buenos días\r\n \r\n \r\nSolicitamos su colaboración para que se revise de nuevo el desarrollo de SIAT PLUS en el proceso de asignación de códigos de alarmas pues se sigue presentando de forma ocasional el error que se salta el número consecutivo de una alarma\r\n \r\nVer el detalle de los correos siguientes remitidos por funcionarios del proyecto TIC MOVIL\r\n \r\nCordialmente', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('78', 'Se presenta el error consultando los registros con los filtros del formulario  ; se debe a que el WHERE lo realiza a la tabla documental y no a la tabla operador.', '', 'Información actual: \r\nFROM documento d\r\n     INNER JOIN documento_tipo td ON d.dti_id = td.dti_id\r\n     INNER JOIN documento_tema tm ON d.dot_id = tm.dot_id\r\n     INNER JOIN documento_subtema sd ON d.dos_id = sd.dos_id\r\n     INNER JOIN documento_estado ted ON ted.doe_id = d.doe_id\r\n     INNER JOIN contrato_kvd ck ON ck.contrato_kvd_id = d.contrato_kvd_id\r\n     INNER JOIN fase f ON f.fase_id = ck.fase_id\r\n     LEFT JOIN operador o ON ck.ope_id = o.ope_id\r\nWHERE d.dos_id = 9 AND d.ope_id = 3 AND f.fase_id = 3 AND d.dot_id = 2\r\n\r\nInformación nueva: \r\nFROM documento    d\r\n     INNER JOIN documento_tipo td ON d.dti_id = td.dti_id\r\n     INNER JOIN documento_tema tm ON d.dot_id = tm.dot_id\r\n     INNER JOIN documento_subtema sd ON d.dos_id = sd.dos_id\r\n     INNER JOIN documento_estado ted ON ted.doe_id = d.doe_id\r\n     INNER JOIN contrato_kvd ck ON ck.contrato_kvd_id = d.contrato_kvd_id\r\n     INNER JOIN fase f ON f.fase_id = ck.fase_id\r\n     LEFT JOIN operador o ON ck.ope_id = o.ope_id\r\nWHERE d.dos_id = 9 AND o.ope_id = 3 AND f.fase_id = 3 AND d.dot_id = 2');
