INSERT INTO `mgms_bug_text_table` VALUES ('81', 'Buenas tardes\r\n \r\nSe observa en el módulo de consulta de verificaciones en SIAT PLUS las visitas registradas como cobertura de vías correspondientes a  validaciones de campo; pero al momento de hacer la validación mediante el módulo de CONSULTAS Y REPORTES DE VERIFICACIONES estas registros no se encuentran, y están se deberían mostrar como VERIFICACIONES DE CAMPO, agradecemos de su colaboración para que el modulo traiga toda la información requerida.', '', '');
