INSERT INTO `mgms_bug_text_table` VALUES ('89', 'Buenos días Nelson: \r\n\r\nDe acuerdo a lo conversado agradezco su colaboración con el cambio de la consulta en el modulo [Financiero] opción [Rendimientos]. \r\n\r\nActualmente la relación de la tabla operador es realizada con la tabla [cuentas_financiero]; pero debe ser con la tabla [contrato_kvd]. \r\n\r\nQuedo atento. \r\n\r\n\r\nCordial saludo, \r\nWilmer Alexander Vargas Díaz - MGM', '', 'from rendimiento_financiero a\r\n, cuentas_financiero b\r\n,cuentas_financiero_tipo c\r\n,operador d\r\n,contrato_kvd e\r\n,fase f \r\nwhere a.cfi_id = b.cfi_id and \r\nb.cft_id=c.cft_id and \r\nb.ope_id = d.ope_id and \r\ne.contrato_kvd_id=b.contrato_kvd_id and \r\ne.fase_id=f.fase_id order by d.ope_id,a.rfi_anio,a.rfi_mes\r\n\r\n/*********************************************************************/\r\n\r\nfrom rendimiento_financiero a\r\n, cuentas_financiero b\r\n,cuentas_financiero_tipo c\r\n,operador d\r\n,contrato_kvd e\r\n,fase f \r\nwhere a.cfi_id = b.cfi_id and \r\nb.cft_id=c.cft_id and \r\ne.contrato_kvd_id=b.contrato_kvd_id and \r\ne.fase_id=f.fase_id \r\ne.ope_id = d.ope_id \r\norder by d.ope_id,a.rfi_anio,a.rfi_mes');
