INSERT INTO `mgms_bug_text_table` VALUES ('181', 'Buen día,\r\n \r\nSolicito de su colaboración para corregir la información en el tablero de control alertas de vehículos que en este momento se registra, inicialmente me informa que está próximo a vencer una tarjeta de operación, pero cuando doy clip en el enlace no muestra ningún registro.', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('182', 'El siguiente error ha sido reportado en ocasiones anteriores pero no se ha obtenido una solución definitiva\r\n \r\n \r\nEn el módulo de gestión de informes – registro de informes cada ve que se requiere cargar un informe SIAT PLUS solicita que se cree el periodo al que pertenece dicho informe, aunque dicho periodo ya está creado\r\n \r\nVer correo  remitido por la usuaria y archivo Word con pantallas de seguimiento a este situación\r\n\r\n\r\nBuenas tardes Juan Pablo\r\n \r\nSolicito tu colaboración con el SIAT PLUS, esto debido a que cada vez que voy a realizar el cargue de los informes el sistema me solicita configurar los periodos antes o de lo contrario no los sube. Te envío adjunto algunos pantallazos tomados como evidencia. Quedo atenta a tu respuesta.\r\n ', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('183', 'Buenos días\r\n \r\nCuando se agrega una obligación a verificar en el módulo de verificaciones SIAT PLUS no actualiza dicha obligación en el módulo de planeación\r\n \r\n \r\n1.       Agregamos obligación a verificación (PC-001) que no seleccionamos en planeación\r\n2.       SIAT PLUS confirma que se agregó obligación\r\n3.       Se completa el registro de las acti vidades de verificación poara las obligaciones seleccionadas\r\n4.       Se ingresa de nuevo a SIAT PLUS\r\n 5.       Verificamos que la obligación PC-001 esta habilitada en el grupo de las obligaciones planeadas para verificar y no esta\r\n', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('184', 'Erika\r\n \r\nCordial Saludo.\r\n \r\nEl S.I. está presentando duplicidad de información al momento del cargue del C.E.V. TPR1 para el ID 230 (sede Cuervo Araoz) de Mitú (Vaupés). Esto ha imposibilitado que el personal de ODC apruebe la visita de interventoría, ya previamente enviada y cargada completamente al S.I. desde el pasado viernes 26 de Mayo de 2017.', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('185', 'Buenos días :\r\n \r\nSolicito de tu colaboración, para revisar el Formato M18-F05, pues se trató de realizar una planeación con ese formato y no se visualiza la programación realizada.\r\n \r\n \r\n1)      Entrar al Modulo  Generadores----- Planeación.\r\n    En Tabla de Planeación :  escoger región : Pacifica, Departamento : Choco.\r\n\r\n2)      Entrar al Municipio Boja ya y luego al Centro Poblado Alfonso López.\r\n\r\n3)      Escoger nombre del Beneficiario Alfonso López, entrar y cliuck en agregar . completo los datos de la planeación con el instrumento “ Evalucaion de Habilidades Y competencias adquiridas por los gestores (revisar el que esta a nombre de etna fajardo)\r\n\r\n4)      Entramos al Modulo Social:  ejecución Apropiacion, para buscar el formato planeado a mi nombre y este no aparece,\r\n\r\nSolicito se revise:\r\nSi el formato  M18-F05 existe en el sistema\r\nCuando fue la última vez que se utilizo\r\nSi fue eliminado , que usuario lo realizo  y en qué fecha.\r\n', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('186', 'Buenos días.\r\n \r\nSolicito su colaboración con la creación del usuario del sistema de información Verifica para la nueva interventora del proyecto.\r\n\r\nNOMBRE\r\nCEDULA\r\nLUGAR\r\nFECHA DE NACIMIENTO\r\nFECHA INGRESO A REDCOM\r\nPROFESION\r\nCELULAR\r\nRH\r\nCORREO CORPORATIVO\r\nAngela Marcela Figueroa Cortés\r\n1.052.383.100\r\nDuitama\r\n28/10/1987\r\n30/05/2017\r\nIngeniera Electricista\r\n3015097908\r\nO+\r\nangela.figueroa@serticsas.com.co\r\n ', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('187', 'Buenos días\r\n \r\n \r\nEn el nuevo desarrollo se encuentra lo siguiente\r\n \r\n1.       Error cosmético\r\n \r\nEl titulo resaltado debe quedar Número RTIC / Expediente\r\n2.       Error grave\r\n \r\n               No almacena los números de RTIC /Expediente\r\n \r\n3.         Se requiere un reporte que se vea en pantalla y se pueda exportar a ecel con la siguiente información\r\n \r\n \r\nTIPO  IDENTIFICACION\r\nNUMERO DE IDENTIFICACION\r\nNOMBRE COMERCIAL O RAZON SOCIAL\r\nTIPO HABILITACION\r\nNUMERO DE RTIC / EXPEDIENTE (Cuando un Prst tenga más de uno deben verse en la misma linea del reporte\r\n \r\n4.       Para evitar duplicidad de información podemos quitar del encabezado del PRST   los campos Número RTIC y  Tipo de registro RTIC pero la infromación alli contenida debe verse en la nueva pestaña que se esta creando\r\n \r\n \r\nCordialmente\r\n', '', '');
