INSERT INTO `mgms_bug_text_table` VALUES ('193', 'Buenos dias,\r\n \r\n \r\nAtentamente solicito la creación de Usuario en Talento al colaborador  ANDRES MAURICIO VILLARRAGA PEDRAZA, de acuerdo con la información de la trazabilidad.\r\n \r\nQuedo atenta.', '', '');
INSERT INTO `mgms_bug_text_table` VALUES ('194', 'Buenos Días\r\n \r\nErika\r\n \r\nCordial Saludo.\r\n \r\nSe presenta inconvenientes en la evaluación 5298 de la verificación 8171 en el ítem de Centro de Cableado - Energía de la sede con ID 227. La sede tiene un sólo centro de cableado (MDF), más sin embargo en el ítem mencionado aparecen cargados 36 verificaciones adicionales que no corresponden a la sede.\r\n \r\nSugiero que se debería agregar en la parte de opciones el cuadro azul para poder inactivar los registros de verificaciones que no corresponden.\r\n \r\nPantallazo Opciones\r\n\r\nPantallazo información de centro de cableado - Energía\r\n\r\nPantallazo de información Rack - centro de cableado.\r\n\r\n', '', '');
