-- View structure for `tiempo_incidencias_v1`
-- ----------------------------
DROP VIEW IF EXISTS `tiempo_incidencias_v1`;
CREATE ALGORITHM=UNDEFINED DEFINER=`mgm_kvd`@`%` SQL SECURITY DEFINER VIEW `tiempo_incidencias_v1` AS select `bugtable`.`id` AS `No_INCIDENCIA`,`projecttable`.`name` AS `PROYECTO`,`categorytable`.`name` AS `APLICACION`,(case `bugtable`.`status` when 10 then 'NUEVA' when 20 then 'SE NECESITAN MÁS DATOS' when 30 then 'ACEPTADA' when 40 then 'EN DESARROLLO' when 50 then 'ASIGNADA' when 80 then 'RESUELTA' when 90 then 'CERRADA' end) AS `ESTADO`,`bugtable`.`summary` AS `RESUMEN`,concat(`usertable3`.`username`,'(',`usertable3`.`realname`,')') AS `REPORTADA_POR_EL_USUARIO`,from_unixtime(`bugtable`.`date_submitted`) AS `FECHA_CREACION`,concat(`usertable4`.`username`,'(',`usertable4`.`realname`,')') AS `ASIGNADA_AL_USUARIO`,concat(`usertable`.`username`,'(',`usertable`.`realname`,')') AS `RESUELTA_POR_EL_USUARIO`,from_unixtime(`bughistory`.`date_modified`) AS `FECHA_RESUELTA`,concat(timestampdiff(DAY,from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bughistory`.`date_modified`)),' DIAS') AS `RESUELTA_EN__`,concat(timestampdiff(HOUR,from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bughistory`.`date_modified`)),' HORAS') AS `RESUELTA_EN_`,concat(timestampdiff(MINUTE,from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bughistory`.`date_modified`)),' MINUTOS') AS `RESUELTA_EN`,concat(`usertable2`.`username`,'(',`usertable2`.`realname`,')') AS `CERRADA_POR_EL_USUARIO`,from_unixtime(`bughistory2`.`date_modified`) AS `FECHA_CERRADA`,concat(timestampdiff(DAY,from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bughistory2`.`date_modified`)),' DIAS') AS `CERRADA_EN_`,concat(timestampdiff(HOUR,from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bughistory2`.`date_modified`)),' HORAS') AS `CERRADA_EN__`,concat(timestampdiff(MINUTE,from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bughistory2`.`date_modified`)),' MINUTOS') AS `CERRADA_EN`,from_unixtime(`bugtable`.`last_updated`) AS `FECHA_ULTIMO_CAMBIO`,concat(timestampdiff(DAY,from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bugtable`.`last_updated`)),' DIAS') AS `TIEMPO_TOTAL_EN__`,concat(timestampdiff(HOUR,from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bugtable`.`last_updated`)),' HORAS') AS `TIEMPO_TOTAL_EN_`,concat(timestampdiff(MINUTE,from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bugtable`.`last_updated`)),' MINUTOS') AS `TIEMPO_TOTAL_EN` from ((((((((`mgms_bug_table` `bugtable` left join `mgms_bug_history_table` `bughistory` on(((`bughistory`.`bug_id` = `bugtable`.`id`) and (`bughistory`.`new_value` = 80)))) left join `mgms_bug_history_table` `bughistory2` on(((`bughistory2`.`bug_id` = `bugtable`.`id`) and (`bughistory2`.`new_value` = 90)))) left join `mgms_project_table` `projecttable` on((`projecttable`.`id` = `bugtable`.`project_id`))) left join `mgms_category_table` `categorytable` on((`categorytable`.`id` = `bugtable`.`category_id`))) left join `mgms_user_table` `usertable` on((`usertable`.`id` = `bughistory`.`user_id`))) left join `mgms_user_table` `usertable2` on((`usertable2`.`id` = `bughistory2`.`user_id`))) left join `mgms_user_table` `usertable3` on((`usertable3`.`id` = `bugtable`.`reporter_id`))) left join `mgms_user_table` `usertable4` on((`usertable4`.`id` = `bugtable`.`handler_id`))) order by `bugtable`.`id` desc ;

-- ----------------------------
-- View structure for `tiempo_incidencias_v2`
-- ----------------------------
DROP VIEW IF EXISTS `tiempo_incidencias_v2`;
CREATE ALGORITHM=UNDEFINED DEFINER=`mgm_kvd`@`%` SQL SECURITY DEFINER VIEW `tiempo_incidencias_v2` AS select `bugtable`.`id` AS `No_INCIDENCIA`,`projecttable`.`name` AS `PROYECTO`,`categorytable`.`name` AS `APLICACION`,(case `bugtable`.`status` when 10 then 'NUEVA' when 20 then 'SE NECESITAN MÁS DATOS' when 30 then 'ACEPTADA' when 40 then 'EN DESARROLLO' when 50 then 'ASIGNADA' when 80 then 'RESUELTA' when 90 then 'CERRADA' end) AS `ESTADO`,concat(`usertable3`.`username`,'(',`usertable3`.`realname`,')') AS `REPORTADA_POR`,from_unixtime(`bugtable`.`date_submitted`) AS `FECHA_CREACION`,`bugtable`.`summary` AS `RESUMEN`,concat(`usertable4`.`username`,'(',`usertable4`.`realname`,')') AS `ASIGNADA_A`,concat(`usertable`.`username`,'(',`usertable`.`realname`,')') AS `RESUELTA_POR`,from_unixtime(`bughistory`.`date_modified`) AS `FECHA_RESUELTA`,sec_to_time(timestampdiff(SECOND,from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bughistory`.`date_modified`))) AS `RESUELTA_EN`,concat(`usertable2`.`username`,'(',`usertable2`.`realname`,')') AS `CERRADA_POR`,from_unixtime(`bughistory2`.`date_modified`) AS `FECHA_CERRADA`,sec_to_time(timestampdiff(SECOND,from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bughistory2`.`date_modified`))) AS `CERRADA_EN`,from_unixtime(`bugtable`.`last_updated`) AS `FECHA_ULTIMO_CAMBIO`,sec_to_time(timestampdiff(SECOND,from_unixtime(`bugtable`.`date_submitted`),if((`bugtable`.`date_submitted` <> `bugtable`.`last_updated`),from_unixtime(`bugtable`.`last_updated`),now()))) AS `TIEMPO_TOTAL`,ifnull(sec_to_time((select sum(`mgms_bugnote_table`.`time_tracking`) from `mgms_bugnote_table` where (`mgms_bugnote_table`.`bug_id` = `bugtable`.`id`) group by `bugtable`.`id`)),'Sin asignar tiempos') AS `SEGUIMIENTO_TIEMPOS` from ((((((((`mgms_bug_table` `bugtable` left join `mgms_bug_history_table` `bughistory` on(((`bughistory`.`bug_id` = `bugtable`.`id`) and (`bughistory`.`new_value` = 80)))) left join `mgms_bug_history_table` `bughistory2` on(((`bughistory2`.`bug_id` = `bugtable`.`id`) and (`bughistory2`.`new_value` = 90)))) left join `mgms_project_table` `projecttable` on((`projecttable`.`id` = `bugtable`.`project_id`))) left join `mgms_category_table` `categorytable` on((`categorytable`.`id` = `bugtable`.`category_id`))) left join `mgms_user_table` `usertable` on((`usertable`.`id` = `bughistory`.`user_id`))) left join `mgms_user_table` `usertable2` on((`usertable2`.`id` = `bughistory2`.`user_id`))) left join `mgms_user_table` `usertable3` on((`usertable3`.`id` = `bugtable`.`reporter_id`))) left join `mgms_user_table` `usertable4` on((`usertable4`.`id` = `bugtable`.`handler_id`))) order by `bugtable`.`id` desc ;

-- ----------------------------
-- View structure for `tiempo_incidencias_v4`
-- ----------------------------
DROP VIEW IF EXISTS `tiempo_incidencias_v4`;
CREATE ALGORITHM=UNDEFINED DEFINER=`mgm_kvd`@`%` SQL SECURITY DEFINER VIEW `tiempo_incidencias_v4` AS select `bugtable`.`id` AS `No_INCIDENCIA`,`projecttable`.`name` AS `PROYECTO`,`categorytable`.`name` AS `APLICACION`,(case `bugtable`.`status` when 10 then 'NUEVA' when 20 then 'SE NECESITAN M?S DATOS' when 30 then 'ACEPTADA' when 40 then 'EN DESARROLLO' when 50 then 'ASIGNADA' when 80 then 'RESUELTA' when 90 then 'CERRADA' end) AS `ESTADO`,ucase(`usertable3`.`realname`) AS `SOLICITADA_POR`,cast(from_unixtime(`bugtable`.`date_submitted`) as datetime) AS `FECHA_SOLICITUD`,`bugtable`.`summary` AS `RESUMEN`,ucase(`usertable4`.`realname`) AS `INGENIERO_SOPORTE`,ucase(`usertable`.`realname`) AS `RESUELTA_POR`,from_unixtime(`bughistory`.`date_modified`) AS `FECHA_Y_HORA_SOLUCION`,sec_to_time(timestampdiff(SECOND,from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bughistory`.`date_modified`))) AS `TIEMPO_SOLUCION`,sec_to_time(`FDS`(from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bughistory`.`date_modified`))) AS `TIEMPO_SOLUCION_SIN_FDS`,ucase(`usertable2`.`realname`) AS `CERRADA_POR`,from_unixtime(`bughistory2`.`date_modified`) AS `FECHA_CERRADA`,sec_to_time(timestampdiff(SECOND,from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bughistory2`.`date_modified`))) AS `TIEMPO_CERRADA`,sec_to_time(`FDS`(from_unixtime(`bugtable`.`date_submitted`),from_unixtime(`bughistory2`.`date_modified`))) AS `TIEMPO_CERRADA_SIN_FDS`,from_unixtime(`bugtable`.`last_updated`) AS `FECHA_ULTIMO_CAMBIO`,sec_to_time(timestampdiff(SECOND,from_unixtime(`bugtable`.`date_submitted`),if((`bugtable`.`date_submitted` <> `bugtable`.`last_updated`),from_unixtime(`bugtable`.`last_updated`),now()))) AS `TIEMPO_TOTAL`,sec_to_time(`FDS`(from_unixtime(`bugtable`.`date_submitted`),if((`bugtable`.`date_submitted` <> `bugtable`.`last_updated`),from_unixtime(`bugtable`.`last_updated`),now()))) AS `TIEMPO_TOTAL_SIN_FDS`,(case `bugtable`.`status` when 90 then 0 else sec_to_time(timestampdiff(SECOND,from_unixtime(`bugtable`.`last_updated`),now())) end) AS `TIEMPO_SIN_RESPUESTA`,(case `bugtable`.`status` when 90 then 0 else sec_to_time(`FDS`(from_unixtime(`bugtable`.`last_updated`),now())) end) AS `TIEMPO_SIN_RESPUESTA_SIN_FDS`,ifnull(sec_to_time((select sum(`mgms_bugnote_table`.`time_tracking`) from `mgms_bugnote_table` where (`mgms_bugnote_table`.`bug_id` = `bugtable`.`id`) group by `bugtable`.`id`)),'Sin asignar tiempos') AS `SEGUIMIENTO_TIEMPOS` from (((((((((`mgms_bug_table` `bugtable` left join `mgms_bug_history_table` `bughistory` on(((`bughistory`.`bug_id` = `bugtable`.`id`) and (`bughistory`.`new_value` = 80)))) left join `mgms_bug_history_table` `bughistory2` on(((`bughistory2`.`bug_id` = `bugtable`.`id`) and (`bughistory2`.`new_value` = 90)))) left join `mgms_project_table` `projecttable` on((`projecttable`.`id` = `bugtable`.`project_id`))) left join `mgms_category_table` `categorytable` on((`categorytable`.`id` = `bugtable`.`category_id`))) left join `mgms_user_table` `usertable` on((`usertable`.`id` = `bughistory`.`user_id`))) left join `mgms_user_table` `usertable2` on((`usertable2`.`id` = `bughistory2`.`user_id`))) left join `mgms_user_table` `usertable3` on((`usertable3`.`id` = `bugtable`.`reporter_id`))) left join `mgms_user_table` `usertable4` on((`usertable4`.`id` = `bugtable`.`handler_id`))) left join `mgms_user_table` `usertable5` on((`usertable5`.`id` = `categorytable`.`user_id`))) where (`bugtable`.`id` >= 1080) order by `bugtable`.`id` desc ;

-- ----------------------------
-- Function structure for `FDS`
-- ----------------------------
DROP FUNCTION IF EXISTS `FDS`;
DELIMITER ;;
CREATE DEFINER=`mgm_kvd`@`%` FUNCTION `FDS`(A DATETIME, B DATETIME) RETURNS bigint(11)
    DETERMINISTIC
    COMMENT 'CALCULAR CANTIDAD DE SEGUNDOS SIN TENER EN CUENTA LOS FINES DE SEMANA'
BEGIN
DECLARE SEGUNDOS_FEC_ENVIO, SEGUNDOS_FEC_RESPUESTA BIGINT;
DECLARE RESULTADO_A, RESULTADO_B VARCHAR(30);
DECLARE TIEMPO_LABORAL BIGINT;
DECLARE TIEMPO_TOTAL BIGINT;
DECLARE HORA_INICIO, HORA_FIN TIME;
DECLARE SEGUNDOS_AL_DIA, SEGUNDOS_TOTAL, C BIGINT;

SET HORA_INICIO = '07:30:00';
SET HORA_FIN = '17:00:00';
SET SEGUNDOS_AL_DIA = TIMESTAMPDIFF(SECOND,HORA_INICIO,HORA_FIN); 
SET TIEMPO_LABORAL = (SELECT workdaydiff(DATE_FORMAT(A, '%Y/%m/%d'), DATE_FORMAT(B, '%Y/%m/%d'))); 

IF DATE_FORMAT(A, '%W') <> 'Saturday' && DATE_FORMAT(A, '%W') <> 'Sunday' THEN 
  SET RESULTADO_A = 'SEMANA';
  SET TIEMPO_LABORAL = TIEMPO_LABORAL - 1;
  SET SEGUNDOS_FEC_ENVIO = IFNULL(TIMESTAMPDIFF(SECOND, TIME(A),HORA_FIN),0);
ELSE
  SET RESULTADO_A = 'FIN DE SEMANA';
  SET SEGUNDOS_FEC_ENVIO = 0;
END IF;

IF DATE_FORMAT(B, '%W') <> 'Saturday' && DATE_FORMAT(B, '%W') <> 'Sunday' THEN
  SET RESULTADO_B = 'SEMANA';
  SET TIEMPO_LABORAL = TIEMPO_LABORAL - 1;
  SET SEGUNDOS_FEC_RESPUESTA = IFNULL(TIMESTAMPDIFF(SECOND, HORA_INICIO, TIME(B)),0);
ELSE
  SET RESULTADO_B = 'FIN DE SEMANA';
  SET SEGUNDOS_FEC_RESPUESTA = 0;
END IF;

SET SEGUNDOS_TOTAL = SEGUNDOS_AL_DIA*TIEMPO_LABORAL; 
IF TIEMPO_LABORAL < 0 THEN
  SET SEGUNDOS_FEC_ENVIO = IFNULL(TIMESTAMPDIFF(SECOND, A,CONCAT(DATE_FORMAT(A, '%Y/%m/%d'), ' ',HORA_FIN)),0);
  SET SEGUNDOS_FEC_RESPUESTA = IFNULL(TIMESTAMPDIFF(SECOND, CONCAT(DATE_FORMAT(B, '%Y/%m/%d'), ' ', HORA_INICIO),B),0);
  SET TIEMPO_TOTAL = SEGUNDOS_TOTAL+SEGUNDOS_FEC_ENVIO+SEGUNDOS_FEC_RESPUESTA;
ELSEIF TIEMPO_LABORAL = 0 THEN
  SET SEGUNDOS_FEC_ENVIO = IFNULL(TIMESTAMPDIFF(SECOND, A,CONCAT(DATE_FORMAT(A, '%Y/%m/%d'), ' ',HORA_FIN)),0);
  SET SEGUNDOS_FEC_RESPUESTA = IFNULL(TIMESTAMPDIFF(SECOND, CONCAT(DATE_FORMAT(B, '%Y/%m/%d'), ' ', HORA_INICIO),B),0);
  SET TIEMPO_TOTAL = SEGUNDOS_FEC_ENVIO+SEGUNDOS_FEC_RESPUESTA;
ELSE
SET TIEMPO_TOTAL = SEGUNDOS_TOTAL+SEGUNDOS_FEC_ENVIO+SEGUNDOS_FEC_RESPUESTA;
END IF;

SET C = TIEMPO_TOTAL;
RETURN C;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `workdaydiff`
-- ----------------------------
DROP FUNCTION IF EXISTS `workdaydiff`;
DELIMITER ;;
CREATE DEFINER=`mgm_kvd`@`%` FUNCTION `workdaydiff`(a DATETIME, B DATETIME) RETURNS int(11)
    DETERMINISTIC
    COMMENT 'CALCULAR CANTIDAD DE SEGUNDOS SIN TENER EN CUENTA LOS FINES DE SEMANA'
BEGIN
DECLARE freedays int;

SET freedays = 0;
SET @x = TIMESTAMPDIFF(day,a, b);
IF @x<0 THEN
SET @m = a;
SET a = b;
SET b = @m;
SET @m = -1;
ELSE
SET @m = 1;
END IF;
SET @x = abs(@x) + 1;

SET @w1 = WEEKDAY(a);
SET @wx1 = 7-@w1;
IF @w1>5 THEN
SET @w1 = 0;
ELSE
SET @w1 = 5-@w1;
END IF;

SET @wx2 = WEEKDAY(b)+1;
SET @w2 = @wx2;
IF @w2>5 THEN
SET @w2 = 5;
END IF;

SET @weeks = (@x-@wx1-@wx2)/7;
SET @noweekends = (@weeks*5)+@w1+@w2;

SET @result = @noweekends-freedays;
RETURN @result*@m;
END
;;
DELIMITER ;
